setcpm(123/4)

// Fiddle-like melody - lively arpeggios
$: note("<[bb4 d5 f5 d5] [c5 eb5 g5 eb5] [d5 f5 bb5 f5] [f5 a5 c6 a5]>")
.s("sawtooth").lpf(2800).room(0.3).gain(0.45)

// Counter melody - second fiddle
$: note("<[f4 bb4 d5] [g4 c5 eb5] [bb4 d5 f5] [a4 c5 f5]>".slow(2))
.s("triangle").lpf(2200).delay(0.15).gain(0.35)

// Accordion-like pad chords
$: note("<[bb3,d4,f4] [c4,eb4,g4] [d4,f4,bb4] [f4,a4,c5]>")
.s("square").lpf(1200).room(0.4).gain(0.25)

// Warm bass - Celtic groove
$: note("<bb2 [bb2 f2] [bb2 c3] [bb2 f2]>")
.s("sine").gain(0.5)

// Bodhrán-style percussion
$: s("bd:2, [~ cp] [~ cp] [~ rim]").gain(0.35)

// Rhythmic texture - foot stomps
$: s("[~ bd:5]*4").gain(0.25).hpf(200)
